import React, { useState } from 'react';
import './App.css';

function App() {
  const [url, setUrl] = useState('');
  const [loading, setLoading] = useState(false);
  const [paperAnalysis, setPaperAnalysis] = useState(null);
  const [currentSectionIndex, setCurrentSectionIndex] = useState(0);
  const [error, setError] = useState(null);
  const [analysisStage, setAnalysisStage] = useState('initial'); // 'initial', 'summary', 'references'

  const analyzePaper = async () => {
    setLoading(true);
    setError(null);
    setAnalysisStage('initial');

    try {
      // Initial analysis - just sections and original text
      const response = await fetch('http://localhost:5000/analyze-paper', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ 
          url,
          stage: 'initial'
        }),
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.error || 'Failed to analyze paper');
      }

      const data = await response.json();
      setPaperAnalysis(data);
      setCurrentSectionIndex(0);

      // Start additional analysis
      if (data.sections && data.sections.length > 0) {
        await enrichAnalysis();
      }
    } catch (error) {
      console.error('Error analyzing paper:', error);
      setError(error.message);
    }
    setLoading(false);
  };

  const enrichAnalysis = async () => {
    try {
      // Get summaries
      setAnalysisStage('summary');
      const summaryResponse = await fetch('http://localhost:5000/enrich-analysis', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ 
          sections: paperAnalysis.sections,
          stage: 'summary'
        }),
      });

      if (summaryResponse.ok) {
        const summaryData = await summaryResponse.json();
        setPaperAnalysis(prev => ({
          ...prev,
          summaries: summaryData.summaries
        }));
      }

      // Get references
      setAnalysisStage('references');
      const referencesResponse = await fetch('http://localhost:5000/enrich-analysis', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ 
          sections: paperAnalysis.sections,
          summaries: paperAnalysis.summaries,
          stage: 'references'
        }),
      });

      if (referencesResponse.ok) {
        const referencesData = await referencesResponse.json();
        setPaperAnalysis(prev => ({
          ...prev,
          references: referencesData.references
        }));
      }
    } catch (error) {
      console.error('Error enriching analysis:', error);
    }
  };

  const goToNextSection = () => {
    if (paperAnalysis?.sections && currentSectionIndex < paperAnalysis.sections.length - 1) {
      setCurrentSectionIndex(currentSectionIndex + 1);
    }
  };

  const goToPreviousSection = () => {
    if (currentSectionIndex > 0) {
      setCurrentSectionIndex(currentSectionIndex - 1);
    }
  };

  return (
    <div className="App">
      <div className="content">
        <div className="header-section">
          <h1>Research Paper Analyzer</h1>
          <p className="subtitle-text">Make research papers accessible and interactive</p>
        </div>

        {!paperAnalysis ? (
          <div className="input-section">
            <div className="url-input-container">
              <input
                type="url"
                value={url}
                onChange={(e) => setUrl(e.target.value)}
                placeholder="Enter PDF URL (e.g., https://example.com/paper.pdf)"
                className="url-input"
              />
              {error && <p className="error-message">{error}</p>}
            </div>
            <button 
              onClick={analyzePaper}
              disabled={loading || !url.trim()}
              className={`analyze-button ${loading ? 'loading' : ''}`}
            >
              {loading ? (
                <>
                  <span className="spinner"></span>
                  <span style={{ marginLeft: '12px' }}>Analyzing paper...</span>
                </>
              ) : (
                'Analyze Paper'
              )}
            </button>
          </div>
        ) : paperAnalysis.sections && paperAnalysis.sections.length > 0 ? (
          <div className="analysis-container">
            <div className="navigation-controls">
              <button 
                onClick={goToPreviousSection}
                disabled={currentSectionIndex === 0}
                className="nav-button"
              >
                ← Previous
              </button>
              <span className="section-counter">
                Section {currentSectionIndex + 1} of {paperAnalysis.sections.length}
              </span>
              <button 
                onClick={goToNextSection}
                disabled={currentSectionIndex === paperAnalysis.sections.length - 1}
                className="nav-button"
              >
                Next →
              </button>
            </div>

            <div className="section-content">
              <h2>{paperAnalysis.sections[currentSectionIndex]?.title}</h2>

              <div className="section-original">
                <h3>Original Text</h3>
                <div className="text-content">
                  {paperAnalysis.sections[currentSectionIndex]?.originalText}
                </div>
              </div>

              {analysisStage === 'initial' && (
                <div className="analysis-progress">
                  <div className="spinner"></div>
                  <p>Analyzing content...</p>
                </div>
              )}

              {analysisStage !== 'initial' && paperAnalysis.summaries && (
                <div className="section-summary">
                  <h3>Summary</h3>
                  <div className="text-content">
                    {paperAnalysis.summaries[currentSectionIndex]?.sectionSummary}
                  </div>
                </div>
              )}

              {analysisStage === 'references' && paperAnalysis.references && (
                <div className="section-references">
                  <h3>Related Topics & References</h3>
                  <ul>
                    {paperAnalysis.references[currentSectionIndex]?.relatedTopics.map((ref, idx) => (
                      <li key={idx}>
                        <a href={ref.url} target="_blank" rel="noopener noreferrer">
                          {ref.title}
                        </a>
                        <p>{ref.description}</p>
                      </li>
                    ))}
                  </ul>
                </div>
              )}
            </div>
          </div>
        ) : (
          <div className="error-message">No sections found in the paper analysis.</div>
        )}
      </div>
    </div>
  );
}

export default App;
